        $month = 'august';
    } elseif ($month == '09') {
        $month = 'september';
    } elseif ($month == '10') {
        $month = 'oktober';
    } elseif ($month == '11') {
        $month = 'november';
    } elseif ($month == '12') {
        $month = 'december';
    }
    if (strlen($month) >= 3) {
        $validDate = true;
    }
}
